import React from 'react';
import ReactDOM from 'react-dom';
import {CarouselItems } from './CarouselItems'//myJson
import Indicator from './Indicator'
import CarouselItem from './CarouselItem'

class MyCarousel extends React.Component {

  render() {
    const carouselItems = this.props.carouselItem.map((singleItem) =>
                      <CarouselItem carouselItem={singleItem} />
                    );

    const carouselIndic = this.props.carouselItem.map((singleItem) =>
                      <Indicator carouselItem={singleItem} />
                    );
    return (
      <Carousel
        carouselId='myCarousel'
        carouselHref='#myCarousel'
        carouselIndicators={carouselIndic}
        carouselItems={carouselItems}/>
    );
  }
}

export default MyCarousel
